import React, {useState} from 'react';
// import data from "./components/data";
import BirthdayToday from "./components/BirthdayToday";
function App() {
  const [people, setPeople] = useState([
    {
        id:1,
        name:"Naseer Ahmad",
        birthday:"04/09/1997",
    },
    {
        id:2,
        name:"Sobia Zulfiqar",
        birthday:"31/07/1999",
    },
    {
        id:3,
        name:"Alina Sheikh",
        birthday:"22/08/1998",
    },
    {
        id:4,
        name:"Alishba Tarick",
        birthday:"1/01/1998",
    },
]);
  const handleClick=()=>{
    console.log(people);
    setPeople([]);
  }
  return (
    <div className="container">
      <h1>{people.length} Birthdays Today</h1>
      <BirthdayToday people={people}/>
      <button onClick={handleClick}>Clear</button>
    </div>
  );
}

export default App;
